import React from "react";
import styles from "./ImageGallery.module.css";
import Image from "./Image";

const ImageGallery = (props) => {
  return (
    <div className={styles.container}>
      <img src={props.src1} alt="Project One Done By Louis Riddle" />
      <img src={props.src2} alt="Project One Done By Louis Riddle" />
      <img src={props.src3} alt="Project One Done By Louis Riddle" />
    </div>
  );
};

export default ImageGallery;
